125.body:
CSS generally follows a very simple syntax. It begins with a selector, which for type selectors is equivalent to the HTML element. This is followed by an opening curly brace { and a list of properties and values to apply to the element named by the selector. Each property / value pair is closed with a semicolon ;. And the selector rule ends with a closing curly brace }. This is expressed in the following generic example: selector { property: value; property: value; property: value;
} As a real example, if we want to change the foreground and background color of all <p> elements in a web document red and black, respectively, we would write the following rule: p { color: red; background-color: black;
}

127.body:
The type selector is the most important selector. The names for these selectors specifically match the names of their HTML element equivalents. As an example, the CSS p selector matches the HTML <p> element. The CSS h1 selector matches the HTML <h1> element. And so forth. In the following example, I use three type selectors: html, h1, and p. I use the html selector to change the foreground and background color to the entire HTML page, since an entire HTML page is enclose within the <html> element. I then show how to apply a sans-serif font-family to the <h1> elements, and a serif font to the <p> elements in a web document: html { background-color: red; color: white;
} h1 { font-family: sans-serif;
} p { font-family: serif;
}

128.body:
The attribute selector is used to style HTML elements with specific attributes. For example, if I use the id attribute throughout a web document, then I can apply CSS to all elements that have an id attribute, regardless of the element type or the value of the attribute. As an example, let's say I have a web document with the following: <h1 id="test1">This is test 1.</h1>
<h2 id="test2">This is test 2.</h2>
<section id="test3"> <p>This is test 3.</p>
</section> Then the following CSS will bold the font for all three heading elements: [id] { font-weight: bold;
} We can also select attributes with specific values: [att=value] : select by attribute with specific value: For example, [id="test1"] would select <h1 id="test1"> [att~=value] : select by attribute where value is a separate word: For example: [id~="test"] would match <h1 id="test one"> and <h2 id="test two"> since test is separate in each.

129.body:
The class selectors focus on styling attributes with specific class names in an HTML document. Consider the following HTML that has three <p> tags with three separate classes: bold, italics, and green: <p class="bold">This text is bold.</p>
<p class="italics">This text is italicized.</p>
<p class="green">This text is green.</p> To use the class selector, I identify the class name in my CSS with the dot name .class_name syntax: .bold { font-weight: bold;
} .italics { font-style: italic;
} .green { color: green;
}

130.body:
Like the class selector, ID selectors identify the ID as the property and its value. To apply an ID selector, we use the pound name syntax #id_name. Recall that while class attributes can be re-used throughout a web document, ID attributes are unique and can only be used once. Consider the following HTML: <section id="news">News</section>
<section id="about">About Us</section>
<section id="store">Store</section> In the above HTML snippet, there can only be one id with a value of news, one id with a value of about, and one id with a value of store. To apply CSS to those specific IDs, we select by the value of the ID attributes. In the example CSS below, I add a black, dotted border that is one pixel thick to the News section, I change the line-height to 1.5 times the element's font-size in the About section, and I convert text in the Store section to all upper case: #news { border-bottom: 1px solid black;
} #about { line-height: 1.5;
} #store { text-transform: uppercase; }

132.body:
The descendant combinator selects an element that is the descendant of another element in the document tree ( Descendant combinator ). These are elements that are contained within other elements. For example, in the following code snippet, the <var> element is a descendant of the <p> element because it is enclosed within the <p> element: <p>Consider the vector <var>X</var>.</p> And in the following snippet, the <h2> element is a descendant of the <section> element. <section> <h2>Heading</h2>
</section> To use the descendant combinator, we simply identify both elements in our CSS. For example, to select the <var> element within the <p> element, we use the following syntax: p var { font-size: 10pt;
} In the above case, the <var> element is a direct descendant of the <p> element. However, we may also select a grandchild or later element by using the asterisk. For example, the following selects all <p> elements within all <section> elements in an HTML page: section * p { font-size: 14pt;
}

133.body:
A Child combinator describes a childhood relationship between two elements ( Child combinators ). A prime example of a child combinator is the HTML list. Consider the following unordered list in HTML, where the <li> element is a child of the <ul> element: <ul> <li>Apples</li> <li>Bananas</li> <li>Grapes</li> <li>Oranges</li>
</ul> To select the <li> child element, we use the following CSS syntax, where I convert all items in the unordered list to lowercase. ul > li { text-transform: lowercase;
} Note that a child element is also a descendant element, so the descendant syntax (e.g., ul li) would also work. The child combinator is simply a more specific type of descendant.

134.body:
Per the W3 documenation, there are two different sibling combinators: the next-sibling combinator and subsequent-sibling combinator ( Sibling combinators ). The next-sibling combinator selects elements that immediately follow another element. Consider the following HTML, where a <p> element is followed by an <hr> (horizontal rule) element, which itself is followed by another <p> element: <p>42 is the answer to life, the universe, and everything in it.</p>
<hr>
<p>What is the question?</p> In the above HTML snippet, the <hr> element is a next-sibling of the first <p> element, and the second <p> element is a next-sibling of the <hr> element. Therefore, to identify the last <p> element in the above snippet, which is the next-sibling of the <hr> element, we use the following next-sibling combinator: hr + p { font-size: 20pt;
} A subsequent-sibling combinator simply extends this relationship down the document tree. Consider the following HTML snippet, which includes a bit of the opening to Leo Tolstoy's novel Anna Karenina. <h1>Anna Karenina / by Leo Tolstoy</h1>
<h2>Chapter 1</h2>
<p>Happy families are all alike; every unhappy family is unhappy in its own way.</p>
<p>Everything was in confusion in the Oblonksy's house....</p> <h2>Chapter 2</h2> We could specifically identify the <h2> elements as subsequent-siblings of the <h1> element with the following CSS syntax: h1 ~ h2 { color: yellow; background-color: black;
}

135.body:
Pseudo-classes are used to select a specific state of an element. There are several types of pseudo-classes, but we will focus on just a few from two categories. For more details on other categories of pseudo-classes as well as a full list, see Pseudo-classes . Dynamic pseudo-classes: :link :visited :hover :active :focus Structural pseudo-classes: :nth-child() :nth-last-child() :first-child The dynamic pseudo-classes :link and :visited are often used to style hyperlinks (aka, the <a> anchor tag). In such situations, :link must be used before :visited. Here is an example of styling hyperlinks in CSS: a:link { text-decoration: green wavy underline;
} a:visited { text-decoration: underline overline;
} The :hover pseudo-class is also often paired with the <a> anchor tag, but it can be used on other elements, too. For example, it's often useful to apply to rows in a <table> to help highlight rows of interest. This will trigger a style change when the mouse cursor hovers over the element: a:hover { color: purple; font-size: 20pt;
} Pseudo-elements are methods to create abstractions about the document tree beyond those specified by the document language ( Psuedo-elements ). For example, there is no such element to indicate the first line in a <p> element, but using the pseudo-class for first-line, we can focus on and style the first line of a <p> (or other) element. For example, consider the following HTML: <p>To be, or not to be, that is the question:<br>
Whether 'tis nobler in the mind to suffer<br>
The slings and arrows of outrageous fortune,<br>
Or to take arms against a sea of troubles<br>
And by opposing end them. To die&mdash;to sleep,<br>
No more;</p> Since there is a <br> tag at the end of each line, the first line is To be, or not to be, that is the question:. Using the pseudo-element for first-line, we can style it by, for example, converting it to uppercase: p::first-line { text-transform: uppercase;
} Other pseudo-classes that can be used include: ::first-letter ::before ::after

139.body:
There are four methods to create or add color to the various parts of our websites. We can use: Color keywords: Basic color keywords : black, silver, gray, red, green, teal, etc. Extended color keywords : aqua, chocolate, cyan, gold, indigo, lime, etc RGB values: The RGB value can declare a specific color: p { color: rgb(255, 241, 0); } (a yellow color) We can add a fourth value to indicate opacity; here I set opacity to 50%: p { color: rgb(255, 241, 0, 0.5); } Hexadecimal values; We can use a hexadecimal value to identify a color: p { color: #fffb00; } Lots of websites list RGB and Hexadecimal values, such as: RGB / Hexademical Color Picker HSL (hue-saturated-lightness) values: HSL is considered more useful than RGB because it's less hardware dependent and considered more intuitive. The values stand for Hue, Saturation, and Lightness: p { color: hsl(291, 100%, 50%); } The Hue is a degree on a color wheel and accepts values from 0 to 360. Saturation and Lightness are coded as percentages. See: HSL Color Picker We can add color to any element, and we can specify which elements to style using the selectors we reviewed in the prior section. As an example, consider the following, abbreviated HTML document: <html> <body> <main> <h1>Heading 1</h1> <section> <h2>Heading 2a</h2> <p>Paragraph 1</p> <p>Paragraph 2</p> <pre><code> #!/usr/bin/env bash for i in * ; do echo "${i}" ; done </code></pre> <h2>Heading 2b</h2> <p>Paragraph 3</p> </section> </main> </body>
</html> We can add background color to the page. In the code below, aliceblue is a color keyword and #000000 is hexadecimal for black: html { background-color: aliceblue; color: #000000;
} We can colorize the headings: h1 ~ h2 { color: yellow; background-color: aqua;
} We can add background color the <section> element to create a box-like effect. The code below uses HSL and RGB, as an example. section { background-color: hsl(360, 100%, 60%); color: rgb(255,241,0,0.5);
} In practice, it's certainly fine to stick to one method (keywords, RGB, HSL, hexadecimal), or mix it up.

140.body:
Like many programming languages, CSS accepts a variety of data types. The common data types in CSS include: Integers: whole numbers (e.g., 1, 42, -5) Floating point, aka, decimal numbers (e.g., 1.5, 3.14, -0.75) Dimensional values: length, width, angle, and more Percentages: fractions represented as percentages These data types are used primarily to add distance or length to elements. There are two broad categories of length and each include a variety of units: Relative lengths: Font-relative lengths: em: relative to the font-size of the parent element. rem: relative to the font-size of the <html> element (root). Defaults to 16px unless overridden. Viewport-relative lengths: vw vh vmin vmax Absolute lengths: cm: centimeters mm: millimeters Q: quarter-millimeters in: inches pt: points (1/72nd of 1 inch) pc: picas (1/6th of 1 inch) px: pixels (1/96th of 1 inch) For the most part, we will rely on relative lengths to adjust fonts and other elements in our HTML pages. This is because relative lengths are more responsive to different device sizes and screen resolutions. However, it's important to know that absolute lengths exist if needed. Consider the following HTML snippet. In the snippet below, I use internal CSS for demonstration purposes, but in practice, use an external stylesheet. <html> <head> <title>sizes</title>
<style>
html { font-size: 1rem;
} header { font-size: 1em;
} h1 { font-size: 2em;
} h2 { font-size: 2em;
} p {
} ul { font-size: 2em;
} li { font-size: 1em;
}
</style> </head> <body> <header> <h1>header 1</h1> <h2>header 2</h2> </header> <p>This is a test. This is only a test. That is all.</p> <ul> <li>item 1</li> <li>item 2</li> <li>item 3</li> <li>item 4</li> </ul> </body>
</html>

142.body:
In the HTML example, note that <header> is a descendant element of the <html> element, and that <h1> and <h2> are siblings and both descendants of <header>. Now consider the following CSS: header { font-size: 1em;
} h1 { font-size: 1em;
} h2 { font-size: 1em;
} Since the header selector has a font-size of 1em, it inherits its font size from the html selector since it's a descendant. Therefore, since 1em = 16px, the <header> element is set to 16px. Since <h1> is inside <header>, and since it uses an em unit of measurement, it inherits its size from the <header> element. Since the h1 selector is set to 2em, then 2em * 16px = 32px. Since <h2> is also inside <header> (it is not a descendant but a sibling to <h1>), it also inherits from <header>. Since the h2 is set to 2em, then as with h1, we have 2em * 16px = 32px. Specifically, since header is set to 1em, its font size is unaffected with respect to html. Therefore, h1 and h2 are both calculated relative to html.

144.body:
Consider the following rules: html { font-size: 1rem;
} header { font-size: 2rem;
} h1 { font-size: 1rem;
} h2 { font-size: 1.5rem;
} We might think that since h1 and h2 are child elements of header, this would result in very large font sizes for <h1> and <h2>. Remember though that rem is always relative to the font-size set in the html selector (typically 16px). Even though the header is set to 2rem, the h1 and h2 rules explicitly define their font sizes using rem. So they ignore the inherited value from header. That is, h1 and h2 are calculated with respect to html. html: 1rem * 16px = 16px h1: 1rem * 16px = 16px h2: 1.5rem * 16px = 24px However, if we only use the following two rules in our CSS: html { font-size: 1rem;
} header { font-size: 2rem;
} Then both h1 and h2 would increase by 2rem since they are direct children of <header>.

145.body:
Viewport relative lengths are useful when controlling the width of the sections on a page, like <main>, <section>, <article>, and like. Consider the following HTML snippet: <html> <head> <title>sizes</title>
<style> header, section { width: 50vw; margin: auto;
} header { text-align: center;
}
</style> </head> <body> <header> <h1><cite>Their Eyes Were Watching God</cite></h1> <h2>Zora Neale Hurston</h2> </header> <section> <p><q>Ships at a distance have every man's wish on board. For some they come in with the tide. For others they sail forever on the horizon, never out of sight, never landing until the Watcher turns his eyes away in resignation, his dreams mocked to death by Time. That is the life of men.</q></p> <p><q>Now, women forget all those things they don't want to remember, and remember everything they don't want to forget. The dream is the truth. Then they act and do things accordingly.</q></p> </section> </body>
</html> In the above code, I set the width of the header and section selectors to 50% of the viewport: width: 50vw;. Since vw (viewport width) is a relative unit, the elements inside these sections will automatically adjust when the browser window is resized. I also set margin: auto;. The result is that the left and right margins will automatically adjust to ensure equal spacing on both sides and will be centered within the page. I also used the text-align: center; for the header selector. This centers all text in the <header> element, which includes the <h1> and <h2> elements. Even though the header is only 50vw wide, the text inside is aligned to the center of that space.

147.body:
The basic principle of working with CSS and HTML is knowing that all HTML elements are contained in a box. This includes everything from the root element <html> all the way down to text-level elements such as the paragraph tag <p> or the <span> tag. We can test this using the universal selector * in our CSS. For example, consider the following HTML, which quotes the first sentence from Moby-Dick: <html> <head> </head> <body> <h1><cite><span class="all_cap">Moby-Dick;</span> or <span class="all_cap">The Whale</span></cite></h1> <h2>By Herman Melville</h2> <p><q>Call me Ishmael. Some years ago&mdash;never mind how long precisely&mdash;having little or no money in my purse, and nothing particular to interest me on shore, I thought I would sail about a little and see the watery part of the world.</q></p> <p>Read the full text at: <a href="https://www.gutenberg.org/ebooks/2701">Project Gutenberg</a></p> </body>
</html> In the following snippet, I add the universal selector to place a box around all elements in the above web document. <html> <head>
<style> * { border: 1px solid black;
}
.all_cap { text-transform: uppercase;
}
</style> </head> <body> <h1><cite><span class="all_cap">Moby-Dick;</span> or <span class="all_cap">The Whale</span></cite></h1> <h2>By Herman Melville</h2> <p><q>Call me Ishmael. Some years ago&mdash;never mind how long precisely&mdash;having little or no money in my purse, and nothing particular to interest me on shore, I thought I would sail about a little and see the watery part of the world.</q></p> <p>Read the full text at: <a href="https://www.gutenberg.org/ebooks/2701">Project Gutenberg</a></p> </body>
</html> CSS treats all HTML elements as rectangular boxes, which can be nested inside or placed next to each other. Understanding this idea that CSS treats HTML elements as boxes is important for styling and designing layouts to our HTML. It's also important to understand that since boxes are nested within other boxes, or sit adjacent to other boxes (e.g., descendant elements, sibling elements, etc), that styling elements has ripple effects. Adjusting a box's size or position affects surrounding elements, as boxes influence each other's layout. Therefore, to fully fully understand how to manipulate HTML elements, we need to understand that CSS boxes possess several properties.

151.body:
Let's start with some basic HTML that contains only a <div> element in the <body>: <html> <head> </head> <body> <div> Building a basic box. </div> </body>
</html> First, we'll add a border around the box, in order to highlight the border edge of the <div> element: <html> <head>
<style> div { border: 1px solid black;
} </style> </head> <body> <div> Building a basic box. </div> </body>
</html> Next, I increase the margin to demonstrate how it adjusts the spacing around the <div> element, pushing it away from adjacent elements. I use the em unit with a value of 2. Since the default value of em is set by the browser to 16px, the box will be offset from adjacent elements by 32 pixels on all four sides: div { border: 1px solid black; margin: 2em;
}

152.body:
The four edges of a box—top, right, bottom, left (in that order)—can be set using a single shorthand property. This shorthand works for the margin and padding properties. In the following example, I set the margin-top to 2em, the margin-right to 3em, the margin-bottom to 1em, and the margin-left to 4em. <html> <head>
<style> div { border: 1px solid black; /* top, right, bottom, left */ margin: 2em 3em 1em 4em;
} </style> </head> <body> <h1>Heading 1</h1> <div>Hello world</div> <h2>Heading 1</h2> </body>
</html>

153.body:
To center a box horizontally, set a fixed width and use margin: auto;. This distributes the remaining space equally on both sides and centers the element within its parent container. In the following snippet, I set the width of the <div> element to 90% of the window. Then by setting margin: auto, the <div> element is centered in the viewing area. <html> <head>
<style> div { border: 1px solid black; width: 90%; margin: auto;
} </style> </head> <body> <h1>Heading 1</h1> <div>Hello world</div> <h2>Heading 1</h2> </body>
</html> Note that we can also use vw to set the width. For example, instead of using width: 90%; we can use width: 50vw;.

156.body:
In the snippet below, the values for the margin and padding properties are set to 10 pixels regardless of the value of the html font size or the <div>'s parent element. <html> <head>
<style> html { font-size: 1rem;
} div { border: 1px solid black; margin: 10px; padding: 10px;
} </style> </head> <body> <div> Building a basic box. </div> </body>
</html>

157.body:
In the snippet below, the values for the margin and padding properties are set to 2em. Since the <body> element's font-size is 20px, and em is relative to its parent, setting margin: 2em; results in 2 * 20px = 40px. <html> <head>
<style> body { font-size: 20px;
}
div { border: 1px solid black; margin: 2em; padding: 2em;
} </style> </head> <body> <div> Building a basic box. </div> </body>
</html> You can test the relationship between the <div> and its parent element <body> by changing the font-size for the body selector.

158.body:
In the following snippet, the font-size for the root <html> element is set to the default, which is 16px (1rem = 16px). Since the margin and padding for the div selector is set to 2rem each, then they will each be 32px (2rem * 16px = 32px). <html> <head>
<style> html { font-size: 1rem;
}
div { border: 1px solid black; margin: 2rem; padding: 2rem;
} </style> </head> <body> <div> Building a basic box. </div> </body>
</html>

159.body:
In the snippet below, the p selector uses rem units, and therefore its size is calculated with respect to the root element. However, the b selector (for the <b> element in the HTML section) uses em units. Since the em unit is calculated with respect to the parent element, and since the parent element in this case is the <p> element, then the size of the text enclosed in the <b> element is calculated with respect to the <p> element. <html> <head>
<style> html { font-size: 1rem;
} p { border: 1px solid black; margin: 2rem; padding: 2rem;
} b { border: 1px solid black; margin: 2em; padding: 2em;
}
</style> </head> <body> <p>This is <b>bold.</b></p> </body>
</html>

160.body:
We have already discussed the last property: content . Increasing font-size expands the content area, causing the box to grow accordingly. In the following code snippet, I have an <h1> element with some simple text: <html> <body> <section> <h1>Heading 1</h1> </section> </body>
</html> Now let's add a border around that. This will reveal how the element is wrapped in a box: <html> <head> <style>
h1 { border: 1px solid black;
}
</style> </head> <body> <section> <h1>Heading 1</h1> </section> </body>
</html> Increasing the font-size enlarges the content, which in turn expands the overall box dimensions. <html> <head> <style>
h1 { border: 1px solid black; font-size: 5em;
}
</style> </head> <body> <section> <h1>Heading 1</h1> </section> </body>
</html>

