The class attribute can be assigned to most HTML tags and is used to group multiple HTML elements together under a common name. This makes it easier to apply a shared style (CSS) or behavior (JavaScript) to the group of elements. For example, we can apply a class name to multiple HTML elements to style them similarily: <main class="dark_background"> <article class="light_background"> <section class="dark_background"> <aside class="light_background"></aside> </section> </article>
</main> In CSS, we would refer to the class name to style classes named dark_background similarily and light_background similarily: .dark_background { background-color: black; color: white;
} .light_background { background-color: white; color: black;
}

94.body:
Whereas the class attribute is used to group different elements together, the id attribute is used to uniquely identify a single element on a page. This plays in handy for CSS and JavaScript, too, but because it's like applying a fingerprint to a single element, it can also be used to internal resource links . Here's an example where we have multiple <h3> elements on a page, but we want to distinguish them from each other: <h3 id="linux">Linux</h3>
<h3 id="unix">Unix</h3>
<h3 id="cpm">CP/M</h3> In CSS, we referred to a class name with a dot selector: .dark_background. But for the id name, we refer to it with a pound selector: #linux, #unix, #cpm. For example, to style the above h3 elements separately: #linux { color: red;
} #unix { color: blue;
} #cpm{ color: green;
} One nice side effect of being able to uniquely fingerprint an element on a page with the id attribute is that you can use that attribute to link to it. This is internal resource linking . Thus, imagine a long web page with the above <h3> sections, we could create a table of contents that links to each section using the id attribute: <a href=#linux">Jump to Linux section</a>
<a href=#unix">Jump to Unix section</a>
<a href=#cpm">Jump to CP/M section</a>
